import React from 'react';
import './App.css';
import Alo from './Fondos/1.png'

function App() {
  let documento = document.getElementById("abrirDex");
  function cambiarVelocidad() {
    documento.classList.remove("Alo");
    documento.classList.add("Alo2");
  };
  // const Estilos = {
  // Center: "relative z-10 w-[200px] h-[200px] border-8 border-solid border-black rounded-full bg-blue-200 Centro",
  // };
  return (
    <div className='Main'>
      <img className='Alo' src={Alo} alt='Alo'/>
      <button id='abrirDex' className="Centro" onClick={cambiarVelocidad} ></button>
    </div>
  );
}

export default App;
